import React, { Component} from 'react';
import simpleHoc from './simpleHoc';

class Usual extends Component{
    render(){
        console.log(this.props,'props');
        return(
           <div>
                <div>Usual</div>
                <div>我是高阶组件生产出来的普通组件，import我使用我就可以出来哦</div>
           </div>
        )
    }
}
export default simpleHoc(Usual)
